func isIn(i int, s []int) bool {
	for _, v := range s {
		if i == v {
			return true
		}
	}
	return false
}

func removeDupes(s []int) []int {
	news := make([]int, len(s))

	i := 0
	for _, v := range s {
		if !isIn(v, news) {
			news[i] = v
			i++
		}
	}

	return news
}

func main() {
	for _, s := range alikes {
		sort.Ints(s)
	}

	for i := range alikes {
		alikes[i] = removeDupes(alikes[i])
	}

	m := map[int]rune{}

	for i := range alikes {
		for _, r := range alikes[i] {
			_, ok := m[r]
			if !ok && r > 127 {
				m[r] = proper[i]
			}
		}
	}

	fmt.Printf("package lookalikes\n\nvar lookup = map[rune]rune {\n")
	for k, v := range m {
		fmt.Printf("\t0x%x: '%c',\n", k, v)
	}
	fmt.Printf("}")
}
